import { NavDiv, Logo, MenuDiv, NavLink } from "./styled"

const Navbar = () => {
    return (
        <NavDiv>
            <Logo />
            <MenuDiv>
                <NavLink>Teste</NavLink>
            </MenuDiv>
        </NavDiv>
    )
}

export default Navbar
